column36:
Australians should be aware and really quite concerned that alleged governments and their agencies are breaking laws by unlawfully directing or compelling healthy people to observe unproven medical interventions such as vaccinations or the wearing of masks which are literally medical experiments and which violate section 51 of the Constitution of the Commonwealth, the Declaration of Geneva, the Universal Declaration of Human Rights and the Nuremberg Codes.
What is noteworthy in particular is if the directions by way of so called Chief Medical Officers Directives are unlawful for the reason of the violations of law and worldwide human rights conventions and which are also invalidated by constitutional provisions, then how can retailers that have no enforcement capacity, nor medical qualifications, direct people to do anything at all, especially directing them too participate in medical interventions that they know nothing about, be it the insistence of having proof of vaccination or the wearing masks in their premiseses or climbing aboard their planes and by strange coincidence, heavily subsidised ferries like the Spirit of Tasmania . By so doing they are acting in capacities they are not qualified for and are indeed discriminating against those wishing to engage in the purchase of a product or service. A reasonable amount of examination of the issue indicates that retailers have no business denying anyone access regardless of whether the customer has an “exemption” or not. It is simply not the call of suppliers of goods and services to deny people on the basis of their unqualified and arbitrary opinions and I suggest its a sueable offence.

Please note these selected excerpts:

The Declaration of Geneva reads:
AS A MEMBER OF THE MEDICAL PROFESSION:
I SOLEMNLY PLEDGE to dedicate my life to the service of humanity;
THE HEALTH AND WELL-BEING OF MY PATIENT will be my first consideration;
I WILL RESPECT the autonomy and dignity of my patient;
I WILL MAINTAIN the utmost respect for human life;
I WILL NOT PERMIT considerations of age, disease or disability, creed, ethnic origin, gender, nationality, political affiliation, race, sexual orientation, social standing or any other factor to intervene between my duty and my patient;
I WILL RESPECT the secrets that are confided in me, even after the patient has died;
I WILL PRACTICE my profession with conscience and dignity and in accordance with good medical practice;
I WILL FOSTER the honour and noble traditions of the medical profession;
I WILL GIVE to my teachers, colleagues, and students the respect and gratitude that is their due;
I WILL SHARE my medical knowledge for the benefit of the patient and the advancement of healthcare;
I WILL ATTEND TO my own health, well-being, and abilities in order to provide care of the highest standard;
I WILL NOT USE my medical knowledge to violate human rights and civil liberties, even under threat;
I MAKE THESE PROMISES solemnly, freely and upon my honour.

Section 51 (xxiiiA)  of the Constitution of the Commonwealth of Australia 1901 allows the Commonwealth to attend to  the provision of maternity allowances, widows' pensions, child endowment, unemployment, pharmaceutical, sickness and hospital benefits, medical and dental services (but not so as to authorize any form of civil conscription), benefits to students and family allowances; 

No form of Civil Conscription indicated no compulsion and no coercion.

These provisions from the Nuremberg Code pertain to the conditions that permissible medical experiments may be undertaken and I'm betting that the average Bunnings, Officeworks or Dan Murphy's store manager is completely unaware of the possibility that by asking people on threat of denying them entry that they are committing serious offences and of course ignorance of the law is no excuse in commercial settings.

1. The voluntary consent of the human subject is absolutely essential. This means that the person involved should have legal capacity to give consent; should be so situated as to be able to exercise free power of choice, without the intervention of any element of force, fraud, deceit, duress, overreaching, or other ulterior form of constraint or coercion; and should have sufficient knowledge and comprehension of the elements of the subject matter involved as to enable him to make an understanding and enlightened decision. This latter element requires that before the acceptance of an affirmative decision by the experimental subject there should be made known to him the nature, duration, and purpose of the experiment; the method and means by which it is to be conducted; all inconveniences and hazards reasonably to be expected; and the effects upon his health or person which may possibly come from his participation in the experiment.

